                      </li>
                      <li class="nav-item">
                          <a href="#faq" class="nav-link">FAQ</a>
                      </li>
                      <li class="nav-item">
                          <a href="#contact" class="nav-link">Contact</a>
                      </li>
                  </ul>
                  <button class="btn btn-sm navbar-btn btn-round">Sign in</button>
              </div>
          </div>
      </nav>
        )
    }
}
